    true,nt"url": null,nt"notes": "The Atlas provides lists of spectral lines
    with wavelengths, intensities, and energy level classifications, as well as graphical
    tracings of the observed spectrum of a platinum hollow-cathode lamp containing neon
    carrier gas. The spectrum was recorded photographically and photoelectrically with
    a 10.7 m normal-incidence vacuum spectrograph. Wavelengths and intensities were
    determined for about 5600 lines in the region 1130 u00c5 to 4330 u00c5.",nt"license_title":
